import './App.css';
import {BrowserRouter as Router,Route} from 'react-router-dom'

import PostListAgain from './components/PostListAgain';
import Navbar from './components/Navbar/Navbar'

function App() {
  return (
    <Router>
    <div className="App">
      <Navbar/>


    </div>
    <Route path='/User' component={PostListAgain}></Route>
    </Router>
  );
}

export default App;
